import React, {Component} from 'react';
import './hero.css';
import MonkeyInfo from '../monkey-info/monkey-info.js';
import {CARDS} from '../../config.js'

class Hero extends Component {

    render() {

    return (
      <div className="hero__container">
        <img src="/assets/image-testing.jpg" alt="Green Blocks" className="hero__img" />
        <div>
          <div>Nori grape silver beet broccoli kombu beet greens fava bean potato quandong celery</div>
          <div>Celery quandong swiss chard chicory earthnut pea potato. Salsify taro catsear garlic gram celery bitterleaf wattle seed collard greens nori.</div>  
          <MonkeyInfo content={CARDS[0].monkeyInfo}/>
        </div> 
      </div>  
    );
  } 
}


export default Hero;
